import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Providers from 'providers/';
import AuthForWorker from "./pages/AuthForWorker/AuthForWorker";
import Section5Lending from "./components/Section__5__lending/Section5Lending"; // Виправте шлях відповідно до структури вашого проекту

function App() {
    return (
        <Providers>
            <Routes>
                <Route path="/" element={<Section5Lending />} />
                <Route path="/auth-for-worker" element={<AuthForWorker />} />
            </Routes>
        </Providers>
    );
}

export default App;
